import React, { useState } from 'react';


const Navbar = () => {
    const menuLst = ["Search", "About", "Refer"];
    const [hide, setHide] = useState({
        Search: false,
        About: false,
        Refer: false,

    });
    const mouseEvent = (menuName, bool) => {
        const change = { ...hide };
        change[menuName] = bool;
        setHide(change);
    };


    return (
        <nav className="nav">
            {/* Home 제목 */}
        <a href="/" className="site-title">
            Konfold
        </a>
        {/* 대 메뉴  */}

        <ul className="navContainer">


            <li >
                <a href="/Search">Search</a>
            </li>
            <li>
                <a href="/About">About</a>
            </li>
            <li className={hide[2] ? "active": "none"} 
            onMouseEnter = {()=> mouseEvent(2, true)}
            onMouseLeave = {()=> mouseEvent(2, false)}>
                <a href="/Refer">Reference</a>
            </li>
        </ul>
    </nav>
    );
};

export default Navbar;
